def count_distinct_possible_sums(N: int, A: list) -> int:
    """"""
    if N == 0:
        return 1
    sums = sum(A)
    dp = [[False] * (sums + 1) for _ in range(N)]
    dp[0][0] = True
    dp[0][A[0]] = True
    for i in range(1, N):
        for j in range(sums + 1):
            dp[i][j] = dp[i - 1][j] or (dp[i - 1][j - A[i]] if j - A[i] >= 0 else False)
    return sum(dp[N - 1])
